  type: Struct
  summary: "Representerar ändringar i frekvens för tal innehållet i en <xref href=&quot;System.Speech.Synthesis.TtsEngine.TextFragment&quot;> </xref>."
  remarks: "Breddsteg profil har definierats som en matris med mål i angiven tid positioner i tal-utdata. Varje mål definieras av tre parametrar. Det första värdet är en del av den befintliga texten (ett tal följt av &quot;%&quot;). Det andra värdet anger om du vill öka eller minska vinkeln. Det tredje värdet anger enheten som ska användas för det antal som anges i det andra värdet. Procentuell andel eller hertz (Hz).       ContourPoint objekt hämtas av den <xref:System.Speech.Synthesis.TtsEngine.Prosody.GetContourPoints%2A>metoden eller används för att ange breddsteg profil för en <xref:System.Speech.Synthesis.TtsEngine.TextFragment>av den <xref:System.Speech.Synthesis.TtsEngine.Prosody.SetContourPoints%2A>metoden.</xref:System.Speech.Synthesis.TtsEngine.Prosody.SetContourPoints%2A> </xref:System.Speech.Synthesis.TtsEngine.TextFragment> </xref:System.Speech.Synthesis.TtsEngine.Prosody.GetContourPoints%2A>"
